Today is the Photographer’s day in Argentina 🇦🇷 
Photography has been my passion for the last 25 years and it’s still something that keep me motivated and happy when I take a picture I like 📸
There was a day I decided to take the risk of living doing what I love, and I’m still happy I did it. So after all these years doing what I love “Photography” I think i can call myself a Photographer 😀📸
Thanks to everyone who took all these photos of me on this post and happy day to you all photographers too ❤️
@juanmayerphoto 
