This is me under canopy testing my new KRAKEN, it’s a 7 cells canopy from @flyjyro , a great canopy for wingsuiters but it’s also a really good canopy for vertical freefall jumps!
It has very soft and on heading openings, easy to fly and with a powerful flare, with or without horizontal speed!
So far I’m so happy with this new wing! Thank you so much to my sponsor @flyjyro 🙏🪂
Thanks to @birdyseven for the video!
Edited by @juanmayerphoto 🎥
#canopy #wing #test #happy #fly #juanmayer 
